$(document).ready(function() {
    switch (document.domain) {
        case "ihealth.f5.com": {
            document.querySelector("link[rel*='icon']").href = 'data:image/png;base64,';
            break;
        }
        case "support.f5.com": {
            document.querySelector("link[rel*='icon']").href = 'data:image/png;base64,';
            break;
        }
        default : {
            console.log("domain don't covered in this script");
        }
    }
});